import React from 'react'
import ParticlesForm from '../shared/Animations/ParticlesForm'
import params from '../shared/Animations/particles.json'
import Particles from 'react-particles-js';
import '../shared/Animations/style.css'

const Home = () => {
  return (
    <div>
      <div className="particles">
        <Particles params={params}/>
      </div>
      {/*<ParticlesForm />*/}
      <div className="home">
        <h1 className="display-2 ">Welcome to the GG_clone app</h1>
      </div>
    </div>
  )
}

export default Home
